import React from 'react'

function Form() {
  return (
    <div id='form'>
      <form> 
        <label htmlFor='prompt'>Submit a prompt to Kaia: </label><br/>
        <textarea rows="2" cols="100" disabled="disabled"  placeholder='Write a haiku about rice...' ></textarea><br/>
        <input type='submit' className='prompt-submit'></input>
      </form>
    </div>
  )
}

export default Form
